import React, {Component} from 'react';  




class Album extends React.Component{
    render(){
        return(
            <div className="col-lg-6"> 
                <div className="album">
                    <h1>{this.props.title}</h1>
                    <p>{this.props.para}</p>
                    <img src="" />
                </div>
            </div> 
        );
    }
}

export default Album;
